import { extend } from 'expect';
import React, { Component } from 'react';
import './App.css';
import Card from './cardUI/card.js';
import CollegeList from './colleges.json';

class App extends Component {
  constructor() {
    super();
    this.state = {
      loading: false,
      prevY: 0,
    };
  }

  render() {
    return (
      <div>
        <Card />
        {CollegeList["colleges"].map((collegeDetail, index) => {
          return <Card collegeName = {collegeDetail.college_name} />
        })}
      </div>
    );
  }
}

export default App;
